        <h2>FEED-THROUGH FLY CONTROL</h2>
        <p>Use feed-through fly control, such as <a rel="noopener noreferrer" href="http://centralflycontrol.com/" target="_blank">ClariFly<sup>®</sup> Larvicide</a>. Once ingested, it passes through the livestock and into the animal’s manure, where flies lay eggs. Here, the active ingredient interferes with the life cycle, preventing the adult flies from emerging from the manure by stopping them in the larval stage.</p>
        <p><strong>Click on the logos to learn more.</strong></p>
